import React from 'react';

const AnalysisInst = () => {
  return <div>
      <br />
      <div className='text-secondary'>
          <p>* Performance over years - Number of wins vs years</p>
          <p>* Head to head analysis - Winning statistics when played against each other</p>
          <p>* Support on Twitter - Overall support for each team on Twitter</p>
      </div>
      <p className='text-danger'>Click on the right and left arrows to see the statistics.</p>
  </div>;
};

export default AnalysisInst;
